{
  "ubx_message_extraction": {
    "name": "UBX-NAV-TIMEGAL",
    "class_id": "0x01",
    "message_id": "0x25",
    "description": "Galileo time solution",
    "message_type": "periodic_polled",
    "comment": "This message reports the precise Galileo time of the most recent navigation solution including validity flags and an accuracy estimate.",
    "payload_length": {
      "fixed": 20
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U4",
        "name": "iTOW",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
      },
      {
        "byte_offset": 4,
        "data_type": "U4",
        "name": "galTow",
        "unit": "s",
        "description": "Galileo time of week (rounded to seconds)"
      },
      {
        "byte_offset": 8,
        "data_type": "I4",
        "name": "fGalTow",
        "unit": "ns",
        "description": "Fractional part of the Galileo time of week (range: +/-500000000). The precise Galileo time of week in seconds is: galTow + fGalTow * 1e-9"
      },
      {
        "byte_offset": 12,
        "data_type": "I2",
        "name": "galWno",
        "description": "Galileo week number"
      },
      {
        "byte_offset": 14,
        "data_type": "I1",
        "name": "leaps",
        "unit": "s",
        "description": "Galileo leap seconds (Galileo-UTC)"
      },
      {
        "byte_offset": 15,
        "data_type": "X1",
        "name": "valid",
        "description": "Validity Flags\nbit 0 galTowValid: 1 = Valid galTow and fGalTow (see section Time validity in the integration manual for details)\nbit 1 galWnoValid: 1 = Valid galWno (see section Time validity in the integration manual for details)\nbit 2 leapSValid: 1 = Valid leapS"
      },
      {
        "byte_offset": 16,
        "data_type": "U4",
        "name": "tAcc",
        "unit": "ns",
        "description": "Time Accuracy Estimate"
      }
    ]
  }
}
